import React, { useState } from 'react';
import { Card, TextField, Button, Typography, Grid } from '@mui/material';
import { green } from '@mui/material/colors';
import axios from 'axios';

const BASE_URL = 'http://localhost:8080/'

function Input() {
  const [url, setUrl] = useState('');

  const calculate = async () => {
    const add1 = 1
    const add2 = 2
    const res = await axios.post(`${BASE_URL}/calculate`, { add1, add2})

    console.log(res.data)
  }


  return (
    <Grid container justifyContent="center">
    <Card sx={{ display: "flex", flexDirection: "column", alignItems: "center", m: 2, p: 2, width: 800 }} elevation={4}>
      <TextField 
        label="URL" 
        value={url} 
        onChange={e => setUrl(e.target.value)} 
        variant="outlined" 
        fullWidth 
      />
      <Button variant="contained" color="primary" onClick={calculate} sx={{ mt: 2 }}>
        Shorten
      </Button>
    </Card>
  </Grid>
  );
}

export default Input;
